import React from 'react';
// Hussain idhar home page bana thike me sone jara 30 mins me aata hu {13:16}
function Home(){
    return(
        <div id="homePage-wrapper">
            <div id="NavBar">
                <div id="nav-right"></div>
                <div id="nav-left">
                    <a>Discover</a>
                    <a>Help</a>
                    <button>Sign In</button>
                </div>
            </div>
            <div id="line"><h1>Get Rewarded to SAVE!</h1>
            </div>
        </div>
    )
}

export default Home;
